import React from 'react';
import Navigation from '../components/Navigation';
import SocialNetwork from '../components/SocialNetwork';

const Home = () => {
    return (
        <div>
            <Navigation />
            <SocialNetwork />
            <div className="home-main"></div>
        </div>
    );
};

export default Home;
